import React from 'react';

function Nav() {

    return (
      <nav >
          <div>
            <a href="#">Home</a>
          </div>
          <div>
            <a href="#">Portfolio</a>
          </div>
          <div>
            <a href="#">Contact</a>
          </div>
          <div>
            <a href="#">Resume</a>
          </div>
      </nav>
    );
  }

  export default Nav();
